description:
THE ALEX JONES SHOW
2009.12.23 Wednesday

*** REBROADCASTS ***

Alex talks with Catherine Austin Fitts, the publisher of The Solari Report, the former managing director and member of the board of directors of the Wall Street investment bank Dillon, Read &amp; Co. Inc., and Assistant Secretary of Housing and Federal Housing Commissioner at the Department of Housing and Urban Development in the first Bush Administration. Additional guests include NWO researcher and author Alan Watts, martial artist, actor and media personality Chuck Norris, and Christopher C. Horner, a senior fellow of the Competitive Enterprise Institute and author of the best-selling book Red Hot Lies: How Global Warming Alarmists Use Threats, Fraud and Deception to Keep You Misinformed. 

HOUR 1: Rebroadcast: CATHERINE AUSTIN FITTS with Jason Bermas 12/02/2009

HOUR 2: Rebroadcast: ALAN WATT 12/16/2009

HOUR 3: Rebroadcast: CHUCK NORRIS 12/14/2009

HOUR 4: Rebroadcast: CHRIS HORNER 12/14/2009


88.7 FM Olympia, WA (west side)
